import { createSlice } from "@reduxjs/toolkit";


const AuthSlice = createSlice({
    name:"posts",
    initialState: {
        posts: []
    },
    reducers: {
        authReducer (state, action) {
            console.log(action?.data)
        }
    }
})


export const { authReducer } = AuthSlice.actions;
export default AuthSlice.reducer;
